import './App.css';
import {useState} from "react";
import Axios from 'axios'

function App() {

  const [password , setPassword] = useState("")
  const [title , setTitle] = useState("")

  const addPassword = () => {
    Axios.post('http://localhost:3001/addpassword', {password: password , title: title,});
  };

  return (
    <div className="App">
      <div className="Addpass">
          <input type="text" placeholder="Ex. pass 12345" onChange={(event) => {
            setPassword(event.target.value);
          }}/>
          <input type="text" placeholder="Ex. Facebook" onChange={(event) => {
            setTitle(event.target.value);
          }}/>
          <button onClick={addPassword}> Add Password</button>
      </div>
    </div>
  );
}

export default App;
